import { Dashboard } from '../pages/Dashboard'
import { Reports } from '../pages/Reports'



export const NavigationData:{title:string,path:string,com:any}[] = [
    {
        title: 'Dashboard',
        path: '/',
        com: Dashboard
    },
    {
        title: 'Reports',
        path: '/reports',
        com: Reports
    }
]
